CREATE DEFINER=`AmlakREUser`@`%` PROCEDURE `Avilabel_Cheuqes` (IN `Cheq_No` VARCHAR(200), IN `Cheq_Date` VARCHAR(200), IN `Cheq_Owner` VARCHAR(200), IN `Bank_ArabicName` VARCHAR(200), IN `Tenants_ArabicName` VARCHAR(200), IN `Cheq_Status` VARCHAR(200))  BEGIN
SELECT 
Cq.*,  
Cq_T.Cheque_arabic_Type  , 
B.Bank_Arabic_Name ,
T.Tenants_Arabic_Name ,
T.Tenants_ID,


(select units_Unit_ID from contract where Contract_Id = Cq.contract_Contract_Id )U_ID ,
(select building_Building_Id from units where Unit_ID=U_ID ) B_ID,
(select owner_ship_Owner_Ship_Id from building where Building_Id=B_ID ) O_ID,

